agle foot is made up of 4 muscular toes, powerful enough to carry a large fish through the air. Toes are equipped with large <strong>talons</strong>(strong, sharp and curved claws) used for <strong>capturing</strong>and sometimes <strong>killing </strong>the prey by squeezing and piercing it.</p>\\n\\n<p>Eagles have very <strong>sharp and hooked beaks</strong>. They use it to <strong>rip off </strong>meat or fish.</p>\\n\"},\"library\":\"H5P.AdvancedText 1.1\",\"subContentId\":\"bfa5ee5f-4d40-45a7-b100-7b39f2886995\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"taskDescription\":\"<p>Based on the above text, write correct sentences by filling in the empty spaces with the right word.</p>\\n\",\"checkAnswer\":\"Check\",\"tryAgain\":\"Retry\",\"showSolution\":\"Show solution\",\"behaviour\":{\"enableRetry\":true,\"enableSolutionsButton\":true,\"instantFeedback\":false,\"enableCheckButton\":true},\"textField\":\"The sense organs of the eagle are its *eyes*.\\nThe organs used for approaching its prey are its *wings*.\\nThe organs used for capturing and sometimes killing its prey are its *talons*.\\nThe organ used in consuming its prey is its *beak*.\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"media\":{\"disableImageZooming\":false},\"submitAnswer\": an to another, is called *peristalsis*.\\nChewing, churning and peristalsis movements constitute the *mechanical* digestion of food. As it travels through the tract, food is also mixed with *digestive juices* to be liquefied and further digested to its smallest particles. This is the *chemical* digestion. \\nIn the *small intestine*, digested food is absorbed into the bloodstream. Excess water is absorbed back into the body in the *large intestine*. Undigested food passes from the large intestine out of the *anus* as feces.\",\"overallFeedback\":[{\"from\":0,\"to\":100,\"feedback\":\"You got @score of @total points\"}],\"dropZoneIndex\":\"Drop Zone @index.\",\"empty\":\"Drop Zone @index is empty.\",\"contains\":\"Drop Zone @index contains draggable @draggable.\",\"tipLabel\":\"Show tip\",\"correctText\":\"Correct!\",\"incorrectText\":\"Incorrect!\",\"resetDropTitle\":\"Reset drop\",\"resetDropDescription\":\"Are you sure you want to reset this drop zone?\",\"grabbed\":\"Draggable is grabbed.\",\"cancelledDragging\":\"Cancelled dragging.\",\"correctAnswer\":\"Correct answer:\",\"feedbackHeader\":\"Feedback\",\"scoreBarLabel\":\"You got :num out of :total points\",\"media\":{\"disableImageZooming\":false},\"submitAnswer\":\"Submit\",\"ariaDraggableIndex\":\"@index of @count draggables.\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the task over again.\"},\"library\":\"H5P.DragText 1.10\",\"subContentId\":\"5b7132ae-88bb-419a-8187-d1ddc05955e6\",\"metadata\":{\"contentType\":\"Drag the Words\",\"license\":\"U\",\"title\":\"Exercise 10 -Drag the words into the correct boxes\",\"authors\":[],\"changes\":[],\"extraTitle\":\"Exercise 10 -Drag the words into the correct boxes\"}},\"useSeparator\":\"auto\"},{\"content\":{\"params\":{\"media\":{\"type\":{\"params edback\":{\"chosenFeedback\":\"<div>Right! In the mouth food is mixed with saliva, then it is mixed with gastric juices in the stomach, and finally in the small intestine, food is liquefied (turned into liquid)into simple nutrients with the help of digestive juices secreted by the small intestine, the liver and the pancreas.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Mouth, stomach and small intestine</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>In the esophagus only peristaltic movements are exerted on food that push it downwards to the stomach. No digestive juices are secreted in the esophagus. Try another answer.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Mouth, esophagus and stomach</div>\\n\"},{\"correct\":false,\"tipsAndFeedback\":{\"chosenFeedback\":\"<div>Remember: In the large intestine water is reabsorbed from undigested food to form the stool that will be rejected out of the body through the anus. No more chemical digestion at this stage. Try another answer.</div>\\n\",\"tip\":\"\",\"notChosenFeedback\":\"\"},\"text\":\"<div>Stomach, small intestine and large intestine</div>\\n\"}],\"UI\":{\"checkAnswerButton\":\"Check\",\"showSolutionButton\":\"Show solution\",\"tryAgainButton\":\"Retry\",\"tipsLabel\":\"Show tip\",\"scoreBarLabel\":\"Score\",\"tipAvailable\":\"Tip available\",\"feedbackAvailable\":\"Feedback available\",\"readFeedback\":\"Read feedback\",\"wrongAnswer\":\"Wrong answer\",\"correctAnswer\":\"Correct answer\",\"shouldCheck\":\"Should have been checked\",\"shouldNotCheck\":\"Should not have been checked\",\"noInput\":\"Please answer before viewing the solution\",\"submitAnswerButton\":\"Submit\",\"a11yCheck\":\"Check the answers. The responses will be marked as correct, incorrect, or unanswered.\",\"a11yShowSolution\":\"Show the solution. The task will be marked with its correct solution.\",\"a11yRetry\":\"Retry the task. Reset all responses and start the tas
